DROP TABLE RIVERS PURGE;

CREATE TABLE RIVERS 
(
  ID NUMBER(38, 0) 
, NAME VARCHAR2(30 BYTE) 
, DIAK_CDE VARCHAR2(20 BYTE) 
, NAME2 VARCHAR2(30 BYTE) 
, DIAK_CDE2 VARCHAR2(20 BYTE) 
, TYPE VARCHAR2(20 BYTE) 
, STATUS VARCHAR2(9 BYTE) 
, NAVIG VARCHAR2(12 BYTE) 
, GEOM MDSYS.SDO_GEOMETRY 
);

SET DEFINE OFF;

